import React from "react";
import {BrowserRouter} from "react-router-dom";
import AppRouter from "./components/AppRouter";
import MyNavBar from "./components/MyNavBar";
import {observer} from "mobx-react-lite";


const App = observer(() => {


  return (
    <BrowserRouter >
        <MyNavBar/>
        <AppRouter/>
    </BrowserRouter>
  );
})

export default App;
